import React from "react";


class Inner_nav_item_left extends React.Component{
    render() {
        return (
            <ul className={"bars"} style={{display: this.props.isOpen ? 'block' : 'none'}}>
                {this.props.inner_menu.map((inner_nav_item) => {
                    return (<div className={"list_item col-4"}>{inner_nav_item.map((list_item, j) => {
                        return <li  className={"list_item_li"} key={j}>
                            {list_item.href ? <a href={list_item.href}>{list_item.title}</a> : <h3 className={"sub_header"}>{list_item.title}</h3>}
                            </li>
                        })}</div>
                    )}
                )}
            </ul>

        )
    }
}

export default Inner_nav_item_left;
